    <header id="main-header">Sistema React Crud 1.0 &nbsp;

    <button type="button" class="btn btn-success">button</button>


    </header>


);


const route = (
    <Switch>
    <BrowserRouter>
    <div>
        <Route path="/usuarios" component={Header} exact={true}/>
    </div>
    </BrowserRouter>
    </Switch>
)


export default Header;
